Flattens the input. Does not affect the batch size.

A `Flatten` layer flattens each batch sample in its inputs to 1D (hence the
output is 2D total).

For example:

```js
const input = tf.input({shape: [4, 3]});
const flattenLayer = tf.layers.flatten();
// Inspect the inferred output shape of the flatten layer, which
// equals `[null, 12]`. The 2nd dimension is 4 * 3, i.e., the result of the
// flattening. (The 1st dimension is the undermined batch size.)
console.log(flattenLayer.apply(input).shape);
```

This wrapper applies a layer to every temporal slice of an input.

The input should be at least 3D,  and the dimension of the index `1` will be
considered to be the temporal dimension.

Consider a batch of 32 samples, where each sample is a sequence of 10 vectors
of 16 dimensions. The batch input shape of the layer is then `[32,  10,
16]`, and the `inputShape`, not including the sample dimension, is
`[10, 16]`.

You can then use `TimeDistributed` to apply a `Dense` layer to each of the 10
timesteps, independently:

```typescript
const model = new Sequential();
model.add(new TimeDistributed({
   layer: new Dense({units: 8}),
   inputShape: [10, 16],
});
// Now model.outputShape = [null, 10, 8].
```

The output will then have shape `[32, 10, 8]`.

In subsequent layers, there is no need for `inputShape`:
```typescript
model.add(new TimeDistributed({layer: new Dense(32)});
// Now model.outputShape = [null, 10, 32].
```

The output will then have shape `[32, 10, 32]`.

`TimeDistributed` can be used with arbitrary layers, not just `Dense`, for
instance a `Conv2D` layer.

```typescript
const model = new Sequential();
model.add(new TimeDistributed({
   layer: new Conv2D({filter: 64, kernelSize: [3, 3]}),
   inputShape: [10, 299, 299, 3]
});
```

The `Model` class adds training & evaluation routines to a `Container`.

A `Model` is the basic unit of training, inference and evaluation in
TensorFlow.js. To create a `Model, use `model`.

To create a `Model`, specify its input(s) and output(s). Inputs are
`SymbolicTensor`s provided by `Input` layers. Outputs are `SymbolicTensor`s
provided by other layers that perform mathematical and neural-network
operations.

For example, the following code snippet defines a model consisting of
two `dense` layers, with of 10 and 4 units, respectively.

```js
// Define input, which has a size of 5 (not including batch dimension).
const input = tf.input({shape: [5]});

// First dense layer uses relu activation.
const denseLayer1 = tf.layers.dense({units: 10, activation: 'relu'});
// Second dense layer uses softmax activation.
const denseLayer2 = tf.layers.dense({units: 2, activation: 'softmax'});

// Obtain the output symbolic tensor by applying the layers on the input.
const output = denseLayer2.apply(denseLayer1.apply(input));

// Create the model based on the inputs.
const model = tf.model({inputs: input, outputs: output});

// The model can be used for training, evaluation and prediction.
// For example, the following line runs prediction with the model on
// some fake data.
model.predict(tf.ones([2, 5])).print();
```

See also:
   `Sequential`, `modelFromJSON`, `loadModel`.

